                           PV_ReportView_ReportValueApproachInfo (Path_ReportView__reportValueApproachInfo idPath) (ReportValueApproachInfo {reportValueApproachName = rawMarkdown "Market Comparison Approach", reportValueApproachDescription = rawMarkdown "For this appraisal three valuation methods were considered (from Soucy and Smith, eds, <em>The Appraisal of Personal Property \8211 Principles, Theories, and Practice Methods for the Professional Appraiser</em>, 1994.). The three valuation methods are:\n\n * <bf>Cost Approach to Value</bf> method estimates either the reproduction or replacement of a property, either new or depreciated.\n\n * <bf>Income Approach to Value</bf> method estimates the present worth of anticipated future benefits of owning income producing properties or objects.\n\n * <bf>Sales Comparison Approach to Value</bf> method estimates value by using one or more methods that compare the subject to other similar properties that have been sold in the relevant market with adjustments (up or down) made for all differences that affect value, such as differences in characteristics of value, in market level, and in time.\n\nFor this appraisal three valuation methods were considered.  The three valuation methods are (as defined by The American Society of Appraisers handbook, Principles of Valuation:  Personal Property Valuation Methodology \8211 Research and Analysis):\n\nThe Market Comparison Approach was chosen for this assignment.  The Cost and Income Approaches to value were considered but not appropriate to this assignment.  Although the cost approach would be able to replicate the subject property in form, it would not have represented its age, history and desirability.  The income approach also was not appropriate because an income could not easily be derived from this property.  The client has been placed in the appropriate level of the market considering properties of similar quality, period, style, significance, condition, rarity, and utility.  Based on market data and comparable sales gathered in the appropriate markets.  Market data includes auction records, retail and private sales, dealer's inventories, catalogues, published price lists and price guides.  The appraiser relies on contacts, field notes and conversations with other professionals in this field.  Sources are listed at the end of the report."}),
