                           PV_ReportView_ReportElems (Path_ReportView__reportBody idPath) (fromPairs ([(ReportElemID {unReportElemID = 0},ReportParagraph {elemText = rawMarkdown "#Manuel Robbe\n\n####Biography\n\nA Paris-born painter and printmaker, Manuel Robbe was noted for his experimental approach to printmaking, and during his career created more than 200 aquatints and drypoints.  He was a great technician, inventing a technique known as \"sugar-life\" which gave his prints a startling subtlety. Robbe's technique was developed over several phases.  He printed his design with a mixture of sugar, India ink and gum Arabic, on his zinc plate.  This was followed by heating the plate and working with the soft-ground etching process until the desired result was achieved. Finally, Robbe painted the subject on the zinc plate with an oil paint brush.  For this process he used a special brush made of rags, which was called 'a la poup\233e' (with a doll).  This process was used by French engravers of the 18th century.  In completing his image, Robbe used his fingers to play with the tone on the zinc plate, whereby many of these color prints appear completely unique. He arrived at new shades of color every time he pulled an impression; for example, park scenes appear in spring colors and also in colors associated with autumn.\"\n\nRobbe did images of daily life, especially of beautifully gowned women of obvious comfortable means with their children or involved in leisure activities such as looking in mirrors or perusing artwork.  He also did some landscape subjects.  With his images, Robbe reflected \"la belle \233poque\" or a happy, peaceful time in France at the end of the 19th century and early 20th century before the outbreak of World War I when spririts were relatively high because life seemed peaceful and progressive.  \n\nHe was born in Paris to French parents, refugees from the Franco-Prussion War, from Berthune in northern France.  Robbe attended the Acad\233mie Julian and the Ecole des Beaux Arts and was mentored in his etching and aquatint methods by Eugene Del\226tre.  By 1898, he was exhibiting at the Salon of the Soci\233t\233 Nationale des Beaux-Arts, having changed his commitment from the Societ\233 des Artistes Fran\231ais.  Along with Jacques Villon, Robbe was promoted by Edmond Sagot, Parisian publisher who was one of the most prominent print publishers in western culture at the turn of the century.\n\nBefore 1914, Robbe completed a large number of aquatints in color as well as in black and white, and for his excellence received a Gold Medal at the 1900 Universal Exhibition.  During World War I, he was a pilot, and after the war, his art career waned because of increasing focus on modernist movements such as Cubism and because of his basic shyness that meant he did not aggressively promote his work.  He turned his atelier into a commercial printing shop that has continued into the 21st century."}),(ReportElemID {unReportElemID = 1},ReportItem {elemItem = Item {itemName = "", fields = fromList [(ItemLocation,rawMarkdown ""),(ItemDataSheetNumber,rawMarkdown "Photograph"),(ItemTypeOfObject,rawMarkdown "Fine Art"),(ItemArtistOrMaker,rawMarkdown "Jay Rubenson (Rusensen - in last appraisal)"),(ItemArtistDate,rawMarkdown ""),(ItemCountryOrNationality,rawMarkdown ""),(ItemSubjectOrTitle,rawMarkdown "Northern California"),(ItemSignatureInscriptionsMarkings,rawMarkdown "Signed lower right in mat"),(ItemMediumMaterialsTechniques,rawMarkdown "Silver Print"),(ItemDateOrPeriod,rawMarkdown ""),(ItemSupportBaseFrame,rawMarkdown "Blonde wood frame under glass with double mat"),(ItemFrameMeasurement,rawMarkdown "17 1/8 inches x 21 1/8 inches"),(ItemItemMeasurement,rawMarkdown "9 1/2 inches x 13 1/8 inches"),(ItemProvenance,rawMarkdown ""),(ItemCost,rawMarkdown ""),(ItemCondition,rawMarkdown "Excellent"),(ItemEdition,rawMarkdown ""),(ItemDescription,rawMarkdown "A black and white photograph of a coast scene with rock formations."),(It