illed in him during childhood. \n\nImamura\8217s works record memories of wandering through fields, woods, streams and mountains, and of gazing at the stars at night. Moved by the beauty of wild vines, dilapidated village huts and heavenly constellations, Imamura creates works that reflect his insight into the transience and evolution of life. Included in his abstract compositions of geometric shapes and mysterious signs, are also images of the grasses, leaves, flowers, twigs and rocks that he collects during his walks. Imamura realizes his visions using a complex amalgam of media (etching, engraving, woodblock, aquatint, chine coll\233, collagraph, gold, silver and copper leaf). "),(ItemMarketAnalysis,rawMarkdown ""),(ItemExhibitionsAndPublications,rawMarkdown ""),(ItemAdditionalNotes,rawMarkdown "$850 in last appraisal and still for Dec. 2015"),(ItemCashValue,rawMarkdown "$1,000.00")], images = fromPairs ([(ReportImageID {unReportImageID = 0},Pic {picSize = ImageSize {dim = TheArea, size = 6.0, units = Inches}, picCrop = ImageCrop {topCrop = 0, bottomCrop = 0, leftCrop = 0, rightCrop = 0, rotation = 0}, picCaption = rawMarkdown "", picOriginal = Just (Right (ImageFile {imageFile = File {fileSource = Nothing, fileChksum = "940231b9d5fbda89f69e64dfdd71a13f", fileMessages = []}, imageFileType = JPEG, imageFileWidth = 2048, imageFileHeight = 1536, imageFileMaxVal = 255})), picEditedDeprecated = Nothing, picThumbDeprecated = Nothing, picPrinterDeprecated = Nothing, picMustEnlarge = False, picEnlargedDeprecated = Nothing}),(ReportImageID {unReportImageID = 1},Pic {picSize = ImageSize {dim = TheArea, size = 6.0, units = Inches}, picCrop = ImageCrop {topCrop = 0, bottomCrop = 0, leftCrop = 0, rightCrop = 0, rotation = 0}, picCaption = rawMarkdown "", picOriginal = Just (Right (ImageFile {imageFile = File {fileSource = Nothing, fileChksum = "df5873f6940b029f27a44d627283d8b0", fileMessages = []}, imageFileType = JPEG, imageFileWidth = 2048, imageFileHeight = 1536, imageFile