                           PV_ReportView_MarkupPairs (Path_ReportView__reportGlossary idPath) (fromPairs ([(MarkupPairID {unMarkupPairID = 0},(rawMarkdown "Fillet",rawMarkdown "In the picture framing industry, a fillet (also referred to as a slip) is a small piece of moulding which fits inside a larger frame or, typically, underneath or in between matting, used for decorative purposes. ")),(MarkupPairID {unMarkupPairID = 1},(rawMarkdown "Mat",rawMarkdown "A border going around a picture between picture and frame or serving as the frame")),(MarkupPairID {unMarkupPairID = 2},(rawMarkdown "Lithograph",rawMarkdown "A printing process in which the image to be printed is rendered on a flat surface, as on sheet zinc or aluminum, and treated to retain ink while the non-image areas are treated to repel ink.")),(MarkupPairID {unMarkupPairID = 3},(rawMarkdown "Aquatint",rawMarkdown "A process of etching capable of producing several tones by varying the etching time of different areas of a copper plate so that the resulting print resembles the flat tints of an ink or wash drawing.")),(MarkupPairID {unMarkupPairID = 4},(rawMarkdown "The Belle \201poque",rawMarkdown "The Belle \201poque or La Belle \201poque (French for \"Beautiful Era\") was a period in French and Belgian history that is conventionally dated as starting in 1871 and ending when World War I began in 1914. Occurring during the era of the Third French Republic (beginning 1870), it was a period characterized by optimism, peace at home and in Europe, new technology and scientific discoveries. The peace and prosperity in Paris allowed the arts to flourish, and many masterpieces of literature, music, theater, and visual art gained recognition. ")),(MarkupPairID {unMarkupPairID = 5},(rawMarkdown "Mezzotint",rawMarkdown "A method of engraving a copper or steel plate by scraping and burnishing areas to produce effects of light and shadow.")),(MarkupPairID {unMarkupPairID = 6},(rawMarkdown "Linocut",rawMarkdown "A design cut in relief on linoleum mounted on a wooden block.")),(MarkupPairID {unMarkupPairID = 7},(rawMarkdown "Photogravure",rawMarkdown "An image produced from a photographic negative transferred to a metal plate and etched in."))])),
                           PV_ReportView_MarkupPairs (Path_ReportView__reportSources idPath) (fromPairs ([(MarkupPairID {unMarkupPairID = 0},(rawMarkdown "Online Sources",rawMarkdown "ArtNet.com\nAskart.com\n\nLiveAuctioneers.com\n\nAfterImageGallery\nAndrew Smith Gallery\nAOI Gallery\nArt Sales Index\nBeetles and Huxley\nErnst-Haas.com\nflorgarduno.com\nFriends Without Borders\ngiacobbefritz.com\nJimBonesphotos.com\nKenneth Paul Lesko Gallery\nKenroizu.com\nizuphotography.com\nLesley Kehoe Gallery\nMelinda-k-hall.com\nPDNB\nPeter Fetterman Gallery\nphotographersgallery.com\nPhotographywest.com\nskeetmcauley.net\nsoulcatcherstudio.com\nSteltman Editions\nWorcester Art Museum\nYemen Network Pictures Gallery")),(MarkupPairID {unMarkupPairID = 1},(rawMarkdown "Print Publications",rawMarkdown "Victor Arwas: Belle \201poque, New York, 1978.\n\nKovel, Ralph and Terry, _Kovels's New Dictionary of Marks._New York:  Crown Publishers, 1986.\n\nMaloney, David, _Appraising Personal Property: Principles and Methodology (5th edition)_. Frederick, Maryland: Appraisers Press, 2012.\n\nSoucy, Patricia and Janella N. Smyth, eds. _The Appraisal of Personal Property: Principles, Theories and Practice Methods for the Professional Appraiser._ Washington, D.C.:  American Society of Appraisers, 1994.\n\n_Uniform Standards of Professional Appraisal Practice, the 2012-2013 Edition_(USPAP). Washington, D.C.: The Appraisal Foundation, 2012."))])),
                           PV_ReportView_Markup (Path_ReportView__reportLetterOfTransmittal idPath) (rawMarkdown "As requested, I submit the following appraisal report for the property represented as belonging to the David Matlin and Gail Marie Matlin TTEES, Matlin Revocable Trust.  The subject property consists of:\n\n* A Collection of Fine Art & Decorative Art\n\nYou provided me with the information that indicates that you own the subject property listed above in its entirety. This appraisal report provides the appraisal conclusion of Replacement Value (comparable) for the purpose of Insurance Coverage.  In this report, \8220Replacement Value\8221 refers to the price in terms of cash or other precisely revealed terms that would be required to replace a property with another of similar age, quality, origin, appearance, provenance and condition within a reasonable length of time in an appropriate and relevant market*.  Please note that this appraisal and the concluded replacement value are only for purpose of Insurance Coverage.\n* = As defined by The Appraisal of Personal Property \8211 Principles, Theories, and Practice Methods for the Professional Appraiser, 1994.\n\nThis report will function as documented evidence of this appraiser having witnessed the subject properties, and identified, described and valued the subject properties in the context of estimating Replacement Value.  At the time of the examination, December 4, 2015 and the property was located at: \n\n\n**4635 56th Street, San Diego, CA 92115**\n\nAfter thorough consideration of available facts and statistics, on: December 4, 2015, the REPLACEMENT VALUE of the personal property effectively valued is:\n\nReplacement Value:  [TotalValue] __[TotalValueAsText]__\n\nThis figure does not reflect a consideration for related sales taxes and deliver/installation charges, which can vary.  This professional opinion is based upon our knowledge and experience in the valuation of personal property and residential contents.  This appraisal is based on our research and analysis of the property and knowledge of relevant markets where the property is traded.\n\nThis is a self-contained appraisal report that was prepared to conform to the Code of Ethics of the American Society of Appraisers and the current version of the Uniform Standards of Professional Appraisal Practice 2012 (USPAP), published by the Appraisal Foundation.  I have no past, present or contemplated future interest in the property included in this report.  My fee was not contingent on any value finding.\n\nThis [ReportLength] page report consists of an executive summary, photographs, limiting conditions, inventory, summary page, bibliography, credentials and list of sources.  All these elements must be present for the value conclusion to be valid.\n\nThe appraiser signing this report is a qualified appraiser within the meaning of Internal Revenue Reg. 1.170A-17(b) and am not an excluded appraiser within the meaning of 1.170A-17(b)(5). Garrett R. Goldfield holds the Accredited Senior Appraiser in Fine Arts designation and Residential Contents.  My background, education and experience qualifies me to make appraisals of the type of property that is the subject of this appraisal. A complete list of my qualifications can be found in the Credentials statement included in this report. I understand that this appraisal may be used in connection with a return or claim for refund. I also understand that, if a substantial or gross valuation misstatement of the value of the property claimed on the return or claim for refund results from this appraisal, I may be subject to a penalty under section 6695A of the Internal Revenue Code, as well as other applicable penalties. I affirm that we have not been barred from presenting evidence of testimony before the Department of the Treasury or the Internal Revenue Service pursuant to 31 U.S.C. section 330(c). The information in this report is confidential.  All notes, electronic, work copies and photographs remain the property of the appraiser and are retained for five years, and/or two years after the conclusion of any litigation.  All documents are shredded or otherwise defaced prior to disposal.\n\nThe submission of this report completes our assignment and obligations.  Any further consultation, preparation of additional reports, testimony, or appearances in court or before any governmental forum in reference to the property described in this appraisal will require additional fees to cover the required services.  The aforementioned fees will be billed at the rate commensurate with the timing of the appraisal."),
                           PV_ReportView_Markup (Path_ReportView__reportScopeOfWork idPath) (rawMarkdown "Goldfield Appraisals was hired by [Client] to reach an opinion of the [ValueType] for the donation of a collection of prints belonging to Dr. Albert A. Cutri and Sharon Cutri, for the intended use of Charitable Donation. Based on our discussion with Client, as well as the intended use of the report, the type and location of the subject properties and the effective date of valuation, the appraiser has selected the type of value, the relevant market, the information researched and the analysis to be applied. To complete this assignment we consulted authoritative publications and on-line sources, reviewed published and on-line market data and interviewed knowledgeable dealers and others regarding the subject properties and their relevant markets. \n\nThis report is intended to be an objective, independent, unbiased and credible analysis of known facts.  During the course of our examination, research and analysis, we have endeavored to be accurate and to use due diligence.  This opinion of value was developed using appraisal methods that are within the accepted standard of care for the appraisal profession and within the boundaries of typical practice. \n\nThis appraisal document states the majority of information analyzed, the appraisal procedures followed, and the reasoning that supports the analysis, opinions and conclusions under the requirements of the [USPAP].  It is considered a self-contained report.  The documentation substantiating the value reported is held in the appraisers' files."),
                           PV_ReportView_Markups (Path_ReportView__reportCertification idPath) (fromPairs ([(MarkupID {unMarkupID = 0},rawMarkdown "To the best of my knowledge and belief, the statements of fact continued in this report are true and correct.  The value conclusions are based on my background and experience outlined in the credentials attached at the end of this report."),(MarkupID {unMarkupID = 1},rawMarkdown "The reported analyses, opinions and conclusions are limited only by the reported assumptions and liming conditions.  They are my personal, impartial and unbiased professional analyses, opinions and conclusions.  I have no present or prospective interest in the property that is the subject of this report, and no specified personal interest with respect to the parties involved."),(MarkupID {unMarkupID = 2},rawMarkdown "I have performed no services, as appraisers or in any other capacity, regarding the property that is the subject of this report within the three-year period immediately preceding acceptance of this assignment."),(MarkupID {unMarkupID = 3},rawMarkdown "Analyses, opinions and conclusions in this report were developed and prepared in conformity with the Uniform Standards of Professional Appraisal Practice, 2012."),(MarkupID {unMarkupID = 4},rawMarkdown "Unless otherwise stated, the value given in the Appraisal Report represents the opinion of value as of the date of inspection."),(MarkupID {unMarkupID = 5},rawMarkdown "I have no bias with respect to the property that is the subject of this report, or to the parties involved with this assignment."),(MarkupID {unMarkupID = 6},rawMarkdown "My compensation for completing this assignment is not contingent upon development or reporting of a predetermined value or direction in value that favors the cause of the client, the amount of the value opinion, the attainment of a stipulated result, or the occurrence of a subsequent event directly related to the intended use of this appraisal."),(Marku