orks on paper and photographs that are framed and/or glazed are generally examined without being removed from their frames.  Accordingly, statements as to value may not take into account such factors as the condition and size of print margins, obscured signatures, edition or date information or condition of verso.   Works of art are not subjected to x-ray; evaluation of condition is made on the basis of visual examination without the assistance of special equipment other than ultraviolet light, in some instances.  Over-painting, prior restorations, etc., may not always be apparent to the unaided eye and may not be revealed through the use of ultraviolet light.  No statements are made in this appraisal regarding authenticity of artwork.  Some of the lithographs in this appraisal were removed from frames if the frame was damaged, the signature of the artist was not visible or to verify condition."),(MarkupID {unMarkupID = 5},rawMarkdown "Disclosure of the contents of the appraisal Report is governed by the Bylaws and Regulations of the Appraisal Foundation USPAP 2012.  Neither all nor any part of the contents of this report (especially any conclusions as to the value or the identity of the appraiser) shall be disseminated to the public through advertising, public relations, news, sales, or the media without the prior written consent and approval of the appraiser."),(MarkupID {unMarkupID = 7},rawMarkdown "The opinion of value expressed in this Appraisal Report is the result of and is subject to the data and research described in detail in the Appraisal Report."),(MarkupID {unMarkupID = 8},rawMarkdown "This Appraisal Report, or a copy of this Appraisal Report, may be transmitted to a third party or legal entity only in its entirety and only with the expressed written consent of the appraisal client."),(MarkupID {unMarkupID = 9},rawMarkdown "Information furnished by the owner regarding property history is believed to be reliable; however, no warranty is given for its accuracy."),(MarkupID {unMarkupID = 10},rawMarkdown "The appraiser assumes no responsibility for unforeseen changes in market conditions, nor is the inability to locate a potential buyer or replacement item, at the appraised value, if such is attempted by the client or any other person."),(MarkupID {unMarkupID = 11},rawMarkdown "In the event of a dispute involving interpretation or application of this report, the ASA recommends that such a dispute shall be referred to a neutral third-party mediation service.  The cost of such mediation shall be borne equally by both parties.  In the event mediation is not successful, the parties should agree to submit the dispute to binding arbitration under the laws of the State of California."),(MarkupID {unMarkupID = 12},rawMarkdown "The appraiser has personally inspected the subject property.  The opinion of value expressed in the Appraisal Report is the result of and is subject to the data and research described in detail in the Appraisal Report and on data retained in our files.  The appraisers have not knowingly withheld any significant information."),(MarkupID {unMarkupID = 13},rawMarkdown "Appraisers witness, identify and value subject property but do not claim authentication of the subject properties, unless otherwise noted."),(MarkupID {unMarkupID = 14},rawMarkdown "This Appraisal Report is valid only for the intended use, intended users and for the type of value stated in the appraisal.  The values reported in this appraisal are valid only on the effective date of the appraisal, December 17, 2013."),(MarkupID {unMarkupID = 15},rawMarkdown "In researching comparable sales for the subject properties focus was on researching realized sales that occurred prior to the effective date of this appraisal.  In some cases sales were considered that occurred after the effective date in order to provide direction in identifying market trends near the effective date and to identify whether other comparable sales were anomalies within the