                           PV_ReportView_Markup (Path_ReportView__reportPrivacyPolicy idPath) (rawMarkdown "Goldfield Appraisals makes significant efforts to keep all appraisal-related data confidential in compliance with the current version of the Uniform Standards of Professional Appraisal Practice (USPAP) as published by The Appraisal Foundation. We will not disclose confidential appraisal data to any third party without the written permission of the rightful owner of that data. We will not release a copy of an appraisal you have contracted through Goldfield Appraisals to any third party without the written permission of the client.\n\nOur policy specifies the protection of client information in the following ways:\n\n* We limit access to all information only to those who have a business or professional reason to know and only to nonaffiliated parties as required by law.\n\n* We maintain a secure office and computer environment to ensure that your information is not placed at unreasonable risk.\n\n* The categories of non-public personal information that we collect from a client depend upon the scope of the client\8217s appraisal engagement.  This includes information about personal property assets, information about tax identification numbers, and other non-public information necessary.  Additionally, it may include information about transactions between clients and third parties and information form third party sources.\n\n* Unaffiliated third parties that require access to our clients\8217 personal information, such as Federal and State tax regulators, insurance companies, and the like may only review company records as permitted under law.\n\n* We do not provide client information to mailing list vendors or solicitors for any reason.\n\n* Personally identifiable information will be maintained during the time a client is a client of the company and for 5 years after the appraisal has been completed and/or 2 years after litigation as well as the ethical considerations as specified by USPAP 2012-2013.  After this required period of record retention, all such information will be destroyed."),
