ed the Acad\233mie Julian and the Ecole des Beaux Arts and was mentored in his etching and aquatint methods by Eugene Del\226tre.  By 1898, he was exhibiting at the Salon of the Soci\233t\233 Nationale des Beaux-Arts, having changed his commitment from the Societ\233 des Artistes Fran\231ais.  Along with Jacques Villon, Robbe was promoted by Edmond Sagot, Parisian publisher who was one of the most prominent print publishers in western culture at the turn of the century.\n\nBefore 1914, Robbe completed a large number of aquatints in color as well as in black and white, and for his excellence received a Gold Medal at the 1900 Universal Exhibition.  During World War I, he was a pilot, and after the war, his art career waned because of increasing focus on modernist movements such as Cubism and because of his basic shyness that meant he did not aggressively promote his work.  He turned his atelier into a commercial printing shop that has continued into the 21st century."})
